import { View} from 'react-native';

import AppAlarm from '../../alarm/AppAlarm'


function AlarmScreen() {
    return (
      <View >
        <AppAlarm></AppAlarm>
      </View>
    );
  }

  const styles = StyleSheet.create({
    container:{
        height: '100%',
        backgroundColor:'#FFFAF0',
        alignItems: 'center',
        justifyContent: 'center',
        flexDirection: 'row'
    },
  });

 


  
  
  export default AlarmScreen;
